import React from 'react'
import {Comment} from './Styled'

export default function CommentItem ({comment}) {
    return (
        <Comment >
            <li>
            <div><p>'id':{comment.id}</p></div>
            <div><p>'parent':{comment.parent}</p></div>
            </li>
        </Comment>
    )
}
